script:
var tilesData=get('tiles');
var couchDB = API.cache('couchDB');
var printer = API.cache('printerConfig');
var domain = API.cache('domain');
var couchPublicUrl = 'https://couch.cheminfo.org';
var couchPublicDatabase = 'cheminfo-public';

if(tilesData) {
    tilesData = tilesData.resurrect().map(t => {
        return t.empty ? {} : t;
    })
    tiles('sample-tiles', {
        tiles: tilesData,
        shouldRender: tile => {
            if(tile.hide) return false;
            let user = API.cache('user');
            if(user) user = user.username;
            return (checkRights(user, tile.rights, true));
        },
        ribbon: tile => {
            if(tile.rights) {
                return 'LIMITED';
            } else if (tile.date) {
                const d = new Date(tile.date);
                if(new Date() - d < 1296000000) {
                    return 'NEW';
                }
            }
            return '';
        },
        isActive: tile => {
            if(tile.kind === 'sample') {
                const sample = API.getData('sampleClicked');
                if(sample) return true;
            } else {
                return true;
            }
            return false;
        },
        isLink: tile => true,
        icon: tile => tile.icon,
        title: tile => tile.icon ? '' : checkCache(tile.title),
        backgroundColor: tile => String(tile.bgcolor),
        color: tile => tile.fontcolor || 'black',
        header: tile => tile.description,
        footer: tile => tile.id,
        onTileClick: (event, tile) => {
            if(event.shiftKey && tile.viewURL) {
                return showCode(tile);
            }

            handleTileClick(tile);
        },
        isNewTabLink: (tile) => tile.kind === 'newTab',
        href: (tile) => window.location.origin + tile.viewURL
    });
}



async function showCode(tile) {
    const copiedTile = Object.assign({}, tile);
    delete copiedTile.line;

    const res = await superagent.get(couchPublicUrl + '/' + couchPublicDatabase + '/' + tile.viewURL)
    .set('Accept', 'application/json');
    if(res.status === 200) {
        copiedTile.rev = res.body._rev;
    } else {
        throw new Error('This view might not be public (' + res.status + ')');
    }

    const roc = new Roc({
        url: 'https://mydb.cheminfo.org',
        database: 'visualizer'
    });

    let title = '';
    try {
        const view = await roc.get(tile.viewURL);
        if(res.body._rev === view._rev) {
            title = 'Private and public revs match';
        } else {
            title = `Private: rev ${revNumber(view._rev)}, Pubilc: rev ${revNumber(res.body._rev)}`;
        }
    } catch(e) {
        title = 'not able to get private revision of the view';
    }

    try {
        await UI.showCode({
            mode: 'json',
            content: JSON.stringify(copiedTile, null, '\t'),
            title: title
        });    
    } catch(e) {
        UI.showNotification(e.message, 'error');
    }
}

function handleTileClick(tile) {
    console.log(tile)
    var sample = API.getData('sampleClicked');
    API.doAction('handleTileClick', {
        sample: {
            uuid: sample && sample.id,
            reference: sample && sample.key.slice(1).join(' ')
        },
        tile
    })
}

function checkCache(val) {
    if(val) {
        const parts = val.split(':');
        if(parts[0] === 'cache') {
            const jpath = parts[1].split('.');
            const name = jpath.splice(0, 1);
            if(jpath.length === 0) return API.cache(name[0]);
            return DataObject.resurrect(DataObject.check(Object.assign({}, API.cache(name[0]))).getChildSync(jpath));
        } else {
            return val;
        }
    }
}

function revNumber(rev) {
    const m = /^(\d+)/.exec(rev);
    return m && m[1];
}

let couchDB = API.cache('couchDB');
let sampleToc = API.cache('sampleToc')
let roc = API.cache('roc');

roc.query('gat_toc').then(function(samples) {
    API.createData('dataGatToc', samples)
})

require(['superagent', 'src/util/ui'], function(superagent, ui) {
    var couchUrl = API.cache('couchUrl');
    var database = API.cache('database');
    var roc = API.cache('rocReaction');
    if(value.$owners.indexOf('anonymousRead') !== -1) {
        makePrivate();
    } else {
        makePublic();
    }

    function getEntry(id) {
        roc.get(id);
    }

    function makePublic() {
        superagent.put(couchUrl + 'db/' + database + '/entry/' + value._id + '/_owner/anonymousRead')
            .withCredentials()
            .then(function(res) {
                if(res.status === 200) {
                    ui.showNotification('reaction was made public', 'success')
                    getEntry(value._id);
                } else {
                    ui.showNotification('make reaction public failed', 'error');
                }
            }).catch(function(err) {
                ui.showNotification('make reaction public failed', 'error');
            });
    }

    function makePrivate() {
        superagent.del(couchUrl + 'db/' + database + '/entry/' + value._id + '/_owner/anonymousRead')
            .withCredentials()
            .then(function(res) {
                if(res.status === 200) {
                    ui.showNotification('reaction was made private', 'success');
                    getEntry(value._id)
                } else {
                    ui.showNotification('make reaction private failed', 'error');
                }
            }).catch(function(err) {
                ui.showNotification('make reaction private failed', 'error');
            });
    }
});

