// For demonstration purpose
if((typeof IframeBridge)!='undefined'){
    IframeBridge.onMessage(function(data) {
        switch (data.type) {
            case 'tab.message':
                switch (data.message.action) {
                    case 'selectEntry':
                        return selectEntry(data.message.uuid);
                    default:
                        console.log('got an unknown message', data.message);
                        return;
                }
                break;
            case 'tab.focus':
                API.doAction('refreshSample');
                break;
        }
    });
    IframeBridge.ready();
}

function selectEntry(uuid) {
    if (!uuid) return;
    const samples = API.getData('filteredSamples');
    if (samples) {
        const index = samples.findIndex(sample => String(sample.id) === uuid);
        if (index !== -1) {
            API.doAction('clickRow', index);
        }
    }
}


API.doAction('afterInit');

